package mrp.service;

public class ServiceResult {
    private final int statusCode;
    private final String body;

    public ServiceResult(int statusCode, String body) {
        this.statusCode = statusCode;
        this.body = body;
    }

    public int getStatusCode() {
        return statusCode;
    }

    public String getBody() {
        return body;
    }
}
